import './App.css';
import Header from './component/Header';
import Main from './component/Main';
import SideBar from './component/SideBar';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to='/'>Home</Link>
            </li>
            <li>
              <Link to='/about'>About</Link>
            </li>
            <li>
              <Link to='/users'>Users</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path='/about'>
            <About />
          </Route>
          <Route path='/'>
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
function Home() {
  return (
    <div className='bg'>
      <Header />
      <div className='containers'>
        <SideBar />
        <Main />
      </div>
    </div>
  );
}

function About() {
  return <h2>About</h2>;
}

export default App;
